import React, { Component } from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Rain from './images/whenitrains.jpg'
import Color from './images/soundsofcolor.jpg'
import Shanghai from './images/loveshanghai.jpg'
import Caprica from './images/caprica.jpg'
import Slanguage from './images/slanguage.jpg'
import Trashley from './images/trashley.png'

class Portfolio extends Component {
// state goes here



// functions go here


  render() {
    return (
      <div id="portfolio">
      <div id="header">Portfolio</div>
      <div id="spring2019"> Spring 2019 </div>
        <div id="spring2019projects">
          <img id="slanguage" src={Slanguage} alt="Slanguage"/>
          <img id="trashley" src={Trashley} alt="Trashley's Journey"/>
        </div>
      <div id="fall2018"> Fall 2018 </div>
        <div id="fall2018projects">
          <img id="whenitrains" src={Rain} alt="When it Rains"/>
          <img id="soundsofcolor" src={Color} alt="The Sounds of Color"/>
          <img id="loveshanghai" src={Shanghai} alt="From Shanghai With Love"/>
          <img id="caprica" src={Caprica} alt="Caprica"/>
        </div>
      </div>
    );
  }
}
export default Portfolio;
